var dummyData = dataz.prospects;

var mapTypes = function (dataz) {
  if(typeof dataz[0] === "undefined") return false;
  var info = dataz[0];
  var typez = {};
  for (var key in info) {
    if (info.hasOwnProperty(key)) {
      typez[key] = typeof info[key];
    }
  }
  return typez;
}

var Headz = Compos.Headz;

var Line = Compos.Line;

var Table = React.createClass({
  getInitialState: function() {
    var types = mapTypes(this.props.data) || {};
    return {
      data:[],
      filters: {},
      types: types
    };
  },
  sortUpdate: function(r) {
    console.log(r);
  },
  handleFilterChange: function(e) {
    var temp = this.state.filters;
    if(e.target.value == "") {
      delete(temp[e.target.name])
    }else{
      var val = this.state.types[e.target.name] == "number"? parseInt(e.target.value): e.target.value;
      temp[e.target.name] = val;
    }
    this.setState(temp);
  },
  FilterData: function () {
    var dataz = [].concat(this.props.data);
    if (_.isEmpty(this.state.filters)) return dataz;
    var ret = [];
    for (var key in this.state.filters) {
      var search = {};
      search[key] = this.state.filters[key];
      // ret = _.concat(ret,  _.filter(dataz, _.matches(search)));
      ret = _.concat(ret,  _.filter(dataz, line => line[key].indexOf(search[key]) > -1 ));
    }
    return ret;
  },
  render: function() {
    var dataz = this.FilterData();
    return (
      <table className="mui-table mui-table--bordered">
        <tbody>
          <Headz first={this.props.data[0]} filtersUpdate={this.handleFilterChange} sortUpdate={this.sortUpdate}/>
          {dataz.map((v)=> <Line key={v.id} data={v}/>)}
        </tbody>
      </table>
    );
  }
});

